export default {
	UpdateLogs: async () => {
		let IP = await JSObject_Method.GetUserIP(); //获取IP
		let TimeStamp = await JSObject_Method.TimeStamp(); //获取当前时间戳

		let Name = await InputName.text; //获取目前名字
		let Level = await Select_Level.selectedOptionValue; //获取目前等级
		let Odo = await InputOdometer.text; //获取目前公里数
		let Title = await InputTitle.text; //获取目前称号
		let Trophy = await InputRgTropy.text; //获取目前奖杯
		let PlateNum = await InputPlateNumber.text; //获取目前车牌
		let Area = await SelectRegionId.selectedOptionValue; //获取目前地区
		let OtherColor = await InputCustomColor.text; //获取目前车检色
		let Wheel = await Select_Wheel.selectedOptionValue; //获取目前车辆轮毂型号

		await storeValue("Logs", {"IPAdress": IP, "TimeStamp": TimeStamp, "Name": Name, "Level": Level, "Odo": Odo, "Title": Title, "Trophy": Trophy, "PlateNum": PlateNum, "Area": Area, "OtherColor": OtherColor, "Wheel": Wheel}, false); //储存信息
		await Insert_Car_Edited_Logs.run(); //上传Logs
	},
	UpdateStoryLogs: async () => {
		let IP = await JSObject_Method.GetUserIP(); //获取IP
		let TimeStamp = await JSObject_Method.TimeStamp(); //获取当前时间戳

		let Number = await appsmith.store.stCount.Number;
		let Div = await appsmith.store.stCount.Div;

		await storeValue("FinalStory", {"Number": Number, "Div": Div, "IPAdress": IP, "Time": TimeStamp}, false); //储存数据
		await Insert_Car_Story_Logs.run(); //上传logs
	}
}
